const Navbar = () => (
  <div>
     <ul>
        <li><Link href="/"><a>Home</a></Link></li>
        <li><Link href="/about"><a>About</a></Link></li>
     </ul>

    <style jsx>{`
       ul {
           background: #333;
           color: #fff;
           list-style: none;
